import React, { Component } from 'react';
import './aboutme.css';
import { Grid, Cell} from 'react-mdl';
import './aboutme.css';
import PatrikContact from '../assets/contact-patrik.png'

class About extends Component {
    render(){
        return(
            <div>
                <Grid>
                <Cell className="left-about" col={4}>
                    <div style={{textAlign: 'left'}}>
                        <img src={PatrikContact} 
                             alt="Photo of Patrik Hogler"
                             style={{height: '350px',}}
                             />

                        <h2 style={{paddingTop: '.7em'}}>Patrik Hogler</h2>
                        <h4 style={{color: 'grey'}}>Front End Developer</h4>
                        <hr style={{width: '50%', borderTop: '3px solid #c70039'}}></hr>
                        <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the 
                            industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type 
                            and scrambled it to make a type specimen book.</p>
                        <hr style={{width: '50%', borderTop: '3px solid #c70039'}}></hr>   
                        <h5>Address</h5>
                        <p>Kvarnbergsplan 2, 14145 Huddinge</p>
                        <h5>Phone</h5>
                        <p>0765576319</p>
                        <h5>E-mail</h5>
                        <p>patrikhogler@hotmail.com</p>
                        <h5>Webb</h5>
                        <p>https://puttetham.github.io/patrikhogler</p>

                    </div>
                </Cell>

                <Cell className="right-about" col={8}>

                </Cell>
                </Grid>
            </div>
        )
    }
}

export default About;
